class SchoolsResponseModel {
  SchoolsResponseModel({
      this.status, 
      this.data, 
      this.message,});

  SchoolsResponseModel.fromJson(dynamic json) {
    status = json['status'];
    if (json['data'] != null) {
      data = [];
      json['data'].forEach((v) {
        data?.add(SchoolsModel.fromJson(v));
      });
    }
    message = json['message'];
  }
  String? status;
  List<SchoolsModel>? data;
  String? message;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = status;
    if (data != null) {
      map['data'] = data?.map((v) => v.toJson()).toList();
    }
    map['message'] = message;
    return map;
  }

}